define(function() {
  /**
   * It defines alert level of component.
   * @type {Object}
   */
  return {
    /**
     * It defines info level. It will display light-blue component
     * @type {string}
     */
    "INFO": "alert-info",
    /**
     * It defines success level. It will display light-green component
     * @type {string}
     */
    "SUCCESS": "alert-success",
    /**
     * It defines warning level. It will display yellow component
     * @type {string}
     */
    "WARNING": "alert-warning",
    /**
     * It defines error level. It will display red component
     * @type {string}
     */
    "DANGER": "alert-danger"
  };
})